import {combineReducers} from "redux";

import stateTable from "../serverViewType/reducers/reducerViewType";
import inputCreateNewData from "../inputCreateNewData/reducers/reducerInputCreateNewData";


const rootReducer = combineReducers({
    stateTable,
    inputCreateNewData
})

export default rootReducer
